  false,\n\t\"url\": null,\n\t\"notes\": \"Web-based searching for available housing
  by location, and links to other federal and private housing resources, as well as
  contracted DHR Online websites. A comprehensive searchable database/front-end that
  applicants and case managers can use to identify housing resources from multiple
  locations/agencies. Housing Portal v2.1 includes a 1) resource entry interface for
  property managers on the Internet and associated FEMA approval interface for these
  records, and 2) reporting capability to generate applicable reports as defined by
  the field, 3) mark all records open for 60+ days as Archived\",\n\t\"license_title\":
